import matplotlib.pyplot as pl

def p(x,y) :
    pl.plot(x,y)
    pl.axis([0,len(x),0,4095])
    pl.show()

def plt(*args) :
    x = []
    for y in args :
        x.append(generate_array(len(y)))

    y = list(args)

    new_y = []
    for element in y :
        a = []
        for e in element :
            if e<20 :
                a.append(e+4096)
            else :
                a.append(e)
        new_y.append(a)
##        print(a)
##        print('----------------------------------')

    y = new_y

    length_array = []
    for m in y :
        length_array.append(len(m))

    const_x = []
    const_y = []
    for i in range(max(length_array)) :
        const_x.append(i)
        const_y.append(4095)
    
    arguments = []
    arguments.append(const_x)
    arguments.append(const_y)
    
    for i in range(len(y)) :
        arguments.append(x[i])
        arguments.append(y[i])

    arguments = tuple(arguments)

    pl.plot(*arguments)
    pl.axis([0,max(length_array),0,4110])
    pl.show()
            
def generate_array(n) :
    return_array = []
    for i in range(n):
        return_array.append(i)
    return return_array

